// SPDX-License-Identifier: MIT
pragma solidity >=0.8.2 <0.9.0;

contract MensajesBasicos {
    address public propietario;

    constructor() {
        propietario = msg.sender;
    }

    modifier soloPropietario() {
        require(msg.sender == propietario, "Solo el propietario puede enviar mensajes");
        _;
    }

    struct Mensaje {
        address remitente;
        address destinatario;
        string  contenido;
        uint256 fecha;
    }

    event MensajeEnviado(
        address indexed remitente,
        address indexed destinatario,
        string contenido,
        uint256 fecha
    );

    mapping(address => Mensaje[]) private bandejaDeEntrada;
    Mensaje[] private historialTotal;

    function enviarMensaje(address _destinatario, string calldata _contenido) external soloPropietario {
        require(_destinatario != address(0), "Direccion destino invalida");
        require(bytes(_contenido).length > 0, "El mensaje no puede estar vacio");

        Mensaje memory m = Mensaje({
            remitente: msg.sender,
            destinatario: _destinatario,
            contenido: _contenido,
            fecha: block.timestamp
        });

        bandejaDeEntrada[_destinatario].push(m);
        historialTotal.push(m);

        emit MensajeEnviado(m.remitente, m.destinatario, m.contenido, m.fecha);
    }


    function cantidadMensajes(address _usuario) external view returns (uint256) {
        return bandejaDeEntrada[_usuario].length;
    }

    function verMensaje(address _usuario, uint256 indice) external view returns (Mensaje memory) {
        require(indice < bandejaDeEntrada[_usuario].length, "Indice fuera de rango");
        return bandejaDeEntrada[_usuario][indice];
    }

    function verHistorial() external view returns (Mensaje[] memory) {
        return historialTotal;
    }
}

